  }

  return (
    <div className="main">
      <h1>
        <Typewriter 
          options={{
            autoStart: true,
            loop: true,
            delay: 80,
            strings: ["Arrange the numbers in ascending order"]
          }}
        />
      </h1>

      <div className="input-div">
        {buckets.map((bucket, index) => (
          <div
              key={index}
              className="star"
              draggable="true"
              onDragStart={(event) => handleDragStart(event, bucket, 'buckets', index)}
              onDragOver={handleDragOver}
              onDrop={(event) => handleDropBucket(event, index)}
          >
            {bucket !== null ? bucket : 'Drop'}
        </div>
    ))}
      </div>

      <div className="options-container" ref={optionsContainerRef}>
        {options.map((option, index) => (
          <div
              key={index}
              className="option"
              draggable="true"
              onDragStart={(event) => handleDragStart(event, option, 'options', index)}
              onDragOver={handleDragOver}
              onDrop={(event) => handleDropOption(event, index)}
          >
          <div>
           {option}
          </div>
          </div>
      ))}
      </div>

      <button
        className="bg-green-400 hover:bg-green-600 px-4 py-2 text-black font-bold rounded mr-2 disabled:bg-green-200 disabled:cursor-not-allowed transition-all duration-300"
        onClick={checkAnswer}
        disabled={buckets.includes(null)}
      >
          Check
      </button>
    </div>
  );
}


export default Main;
